import './main.css'
import Api from '../api/Api'
import React, {useEffect, useState} from 'react';

const Main = () => {

    const [getIp, setIp] = useState();

    useEffect(() => {
        Api
        .get('/ip')
        .then((response) =>setIp(response.data))
        .catch((err) => {
            console.error("Ops, deu  erro" + err);
        })
    }, []);

    function pegaIp(){
        Api.post('/ip/?format=json&location=True', {
            ip: "",
            country: ""
        }).then((response) => {
            setIp(response.data)
        })
    }



   

    return (
        <div className="content2">
            <div class="container">
                <div class="col-12">
                  <label for="name">Nome</label>
                  <input type="text" id="name"/>
                </div>
                 <div class="col-6">
                    <label for="pro">Profiss√£o</label>
                    <input type="text" id="pro"/>
                 </div>
                <div class="col-6">
                     <label for="cel">Celular</label>
                    <input type="text" id="cel"/>
                </div>
                <div class="col">
                    <label for="ip">Ip</label>
                    <input  id="ip" value={ip.ip}/>
                 </div>
                <div class="col-auto align-end">
                    <button onClick={pegaIp}>Encontrar IP</button>
                </div>

                <div class="col-bt align-self">
                    <button>SALVAR</button>
                    
                </div>
                <div class="col-bt align-self">
                    <button>LIMPAR</button>
                    
                </div>
            </div>
        </div>
     );
}
 
export default Main;
